import React from 'react'

function MenuItem({item}) {

  return (
    <div>
        <p>{item.name}</p>
        <p>{item.description}</p>
        <p>{item.price}</p>
        <p>{item.spicy}</p>
        <p>{item.menuOrder}</p>
    </div>
  )
}

export default MenuItem
